import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import Topnav from "../components/Topnav";
import Sidenav from "../components/Sidenav";
import Footer from "../components/Footer";

const DetailAntrian = () => {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);

  const fetchData = () => {
    fetch("http://127.0.0.1:8000/api/v1/" + { id })
      .then((response) => {
        return response.json();
      })
      .then((data) => {
        // console.log(data)
        setLoading(false);
        setData(data);
      });
  };

  useEffect(() => {
    fetchData();
  }, [id]);

  return (
    <div className="wrapper">
      <Topnav />
      <Sidenav />
      <div className="content-wrapper">
        <section className="content">
          <div className="container-fluid">
            <div className="row">
              <div className="col-12">
                <div className="row mt-2 mx-2">
                  <Link to="/dokter/antrian">
                    <button className="btn btn-outline-light btn-sm">
                      <i className="fa fa-arrow-left"></i> Batal
                    </button>
                  </Link>
                </div>
                <div className="card mt-4">
                  <div className="card-header">
                    <h3 className="card-title">Detail Antrian</h3>
                  </div>
                  <div className="card-body">
                    <form>
                      <div className="form-row mt-3">
                        <label className="col-md-3">Nama Pasien</label>
                        <span>Nama_Pasien</span>
                      </div>
                      <div className="form-row mt-3">
                        <label className="col-md-3">NIK</label>
                        <span>XXXXXXXXXXXX</span>
                      </div>
                      <div className="form-row mt-3">
                        <label className="col-md-3">Tgl Periksa</label>
                        <span>Tgl / Bln / Thn</span>
                      </div>
                      <div className="form-row mt-3">
                        <label className="col-md-3">Poliklinik</label>
                        <span>Nama_Poliklinik</span>
                      </div>
                      <div className="form-row mt-3">
                        <label className="col-md-3">Penjamin</label>
                        <span>Nama_Penjamin</span>
                      </div>
                      <div className="form-row mt-3">
                        <label className="col-md-3">No Antrian</label>
                        <span>XX</span>
                      </div>
                    </form>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </section>
      </div>
      <Footer />
    </div>
  );
};

export default DetailAntrian;
